import React from 'react';
import style from './MainHeader.module.css';

const MainHeader = (props) => {
	const content = props.content;

	if (content) {
		const array = content.split(' ');

		let words = [
			<div>
				{array.map((word) => {
					<h1>{word}</h1>;
				})}
			</div>,
		];

		return words;
	}

	return <div>{words}</div>;
};

export default MainHeader;
